    }

    render () {
        return (
            <div className='test'>
                test
                <input type="tel" id="tel" placeholder="请输入电话号码" />
                <button id="phoneCall" onClick={_ => this.toCall()}>打电话</button>
                <button id="getDeviceInfo">获取设备信息</button>
                <button id="onBack">监听返回按钮或返回键</button>
                <input type="file" />
            </div>
        );
    }

    toCall () {
        let { sc } = this
        const telNum = 13023976727
        if (!telNum) {
            console.warn('请输入手机号')
            return
        }


        sc.phoneCall(telNum, (res) => {
            if (res.code !== 0) {
                console.error(res.message)
            }
        })
    }


}



export default Test;
